  '5-3-2 Dikine Oyun',
  '5-3-2 Pas Oyunu'
];

// Menajer oluşturma fonksiyonu
export const generateManager = async (name, leagueName, teamValue = 50) => {
  // CSV verilerini yükle
  const csvData = await loadCSVData();
  
  // Kadro değerine göre önerilen menajer yeteneği hesapla
  const recommendedSkill = getRecommendedManagerSkill(teamValue, csvData?.kadroData);
  
  // Ortalama yetenek ±3 aralığında rastgele değer üret
  const minSkill = Math.max(20, recommendedSkill - 3);
  const maxSkill = Math.min(92, recommendedSkill + 3);
  const baseSkill = Math.floor(Math.random() * (maxSkill - minSkill + 1)) + minSkill;
  
  // M, A, T değerleri (Menajerlik, Hücum, Taktik) - birbirine yakın olsun
  const variation = Math.floor(Math.random() * 5) - 2; // -2 ile +2 arası
  const management = Math.max(20, Math.min(92, baseSkill + variation));
  const attacking = Math.max(20, Math.min(92, baseSkill + Math.floor(Math.random() * 3) - 1));
  const tactical = Math.max(20, Math.min(92, baseSkill + Math.floor(Math.random() * 3) - 1));
  
  // Ortalama yetenek
  const averageSkill = Math.round((management + attacking + tactical) / 3);
  
  // Maaş hesapla
  const salary = getManagerSalary(averageSkill, csvData?.maasData);
  
  // Taktik seçimi
  const tactic = managerTactics[Math.floor(Math.random() * managerTactics.length)];
  
  // Taraftar desteği
  const fanSupport = Math.random() > 0.3 ? 'TAMAM' : 'Kararsız';
  
  // Tazminat ödemesi
  const hasCompensation = Math.random() > 0.4;
  const compensation = hasCompensation 
    ? Math.floor(Math.random() * 5) + 1 // 1-5k arası
    : 0;
  
  return {
    name: name,
    management: management,
    attacking: attacking,
    tactical: tactical,
    averageSkill: averageSkill,
    salary: salary,
    tactic: tactic,
    fanSupport: fanSupport,
    compensation: compensation,
    league: leagueName
  };
};

// 5 rastgele menajer oluşturma
export const generateManagerCandidates = async (leagueName, teamValue = 50) => {
  const candidates = [];
  const availableNames = [...turkishManagerNames];
  
  for (let i = 0; i < 5; i++) {
    const randomIndex = Math.floor(Math.random() * availableNames.length);
    const managerName = availableNames[randomIndex];
    availableNames.splice(randomIndex, 1); // İsmi listeden çıkar
    
    const manager = await generateManager(managerName, leagueName, teamValue);
    candidates.push(manager);
  }
  
  return candidates;
};
